function calculateWindChill(){var e=parseFloat($("body").find("#higTemp").val()),l=parseFloat($("main").find("#lowTemp").val()),a=parseFloat($("body").find("#windSpeed").val()),t=(e+l)/2,n=35.74+.6215*t-35.75*Math.pow(a,.16)+.4275*t*Math.pow(a,.16),d=Number.parseFloat(n).toFixed(2);document.getElementById("windChill").value=d}function reset(){document.getElementById("windChill").value=""}